@prefix : <http://www.semanticweb.org/owl/atm#>
@prefix owl: <http://www.w3.org/2002/07/owl#>
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>

:ATM a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty :logsTransaction ;
        owl:someValuesFrom :UserTransaction
    ] .

:UserTransaction a owl:Class ; 
    rdfs:subClassOf [
        a owl:Restriction ; 
        owl:onProperty :afterCardInsertion ;
        owl:someValuesFrom :Card 
    ] .

:Card a owl:Class .

:logsTransaction a owl:ObjectProperty ;
    rdfs:domain :ATM ;
    rdfs:range :UserTransaction .

:afterCardInsertion a owl:ObjectProperty ;
    rdfs:domain :UserTransaction ;
    rdfs:range :Card .
